import React from 'react';
import logo from '../Images/Logo.jpg';
import '../style/Footer.css';

function Footer() {
    return (
        <div>
            <footer className="footer">
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <img src={logo} className="footer-logo" alt="Image" />
                            <p>vaydgawu</p>
                        </div>
                    </div>
                </div>
            </footer>
        </div>
    )
}

export default Footer;
